import React from 'react'

function Signin() {
    return (
        <div>
        <h1>Welcome Back!</h1>
        <input id="username" placeholder="username"/>
        <input id="password" placeholder="password" type="password"/>
        <button>Sign In</button>
        </div>
)
}

export default Signin
